window.bookSummaryJSON = "<p>Santa is going to stuff their stockings...</p> <p>Sisters A-Vay and A-Ven are close to finishing their course in Alien Abduction at the prestigious Intergalactic University. To stay top of their class, they need to perform the best abduction Earth has never seen.</p> <p>After weeks of monitoring the planet's communications, they've set their eyes on Earth's most famous man, a guy with a white beard and red coat. He may be old but he's ho-ho-hot and his bells still jingle!</p> <p>Now if only the sisters knew what to do about the reindeer in the cargo bay...</p> <p>A steamy stand-alone story set in the Starlight Universe. If you want a hilarious audiobook involving insatiable alien twin sisters and a Santa with a very large candy cane, scroll up and listen this audiobook today. Beware, you may be abducted at any moment, so don't waste time.</p>"; 
